import React from 'react';

function App() {
    return (
        <>
            <ul>
                <li>Sum            = {add(2, 3)}</li>
                <li>Subtraction    = {sub(3, 2)}</li>
                <li>Division       = {div(10, 3)}</li>
                <li>Multiplication = {mul(10, 3)}</li>
            </ul>
        </>
    );
}

export default App;
